val age_user = user_fields.map(array => (array(0),array(1))).sortBy(_._2,true)
case class Age(id : Int, age: Int)
val age_user_df = age_user.map(array => Age(array._1.toInt,array._2.toInt)).toDF()

val range = Map(0 ->9,10 -> 19, 20 -> 29,30 -> 39,40 -> 49,50 -> 59,60 -> 69,70 -> 79)
val result_map  = scala.collection.mutable.Map[String,Long]()
for((k,v) <- range.par){
    val count = age_user_df.filter($"age">= k and $"age" <= v).count();
    val key = k + "~" + v;
    result_map += (key -> count)
}
val age_period_table = result_map.toSeq.sortBy(_._1).map(line => (line._1 + "\t" + line._2)).toList.mkString("\n")
print("%table age_period\tcount\n" + age_period_table)

